import React, { useState } from "react";
import PropTypes from "prop-types";
import { useTranslation } from "react-i18next";

import { Row, Col, Card, CardBody, Button, Label } from "reactstrap";
import AvInput from "availity-reactstrap-validation/lib/AvInput";

import { AvForm, AvField, AvGroup } from "availity-reactstrap-validation";
import Select from "react-select";
import Switch from "react-switch";
import Breadcrumb from "../../../../components/Common/Breadcrumb";
import { withTranslation } from "react-i18next";

const Offsymbol = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100%",
        fontSize: 12,
        color: "#fff",
        paddingRight: 2,
      }}
    >
      {" "}
      No
    </div>
  );
};

const OnSymbol = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100%",
        fontSize: 12,
        color: "#fff",
        paddingRight: 2,
      }}
    >
      {" "}
      Si
    </div>
  );
};

const PantallaBusqueda = (props) => {
  const [showResults, setShowResults] = useState(false);
  const [dataList, setDataList] = useState([]);
  const [loading, setLoading] = useState(false);
  const [displayClienteModal, setDisplayClienteModal] = useState(false);
    const { t, i18n } = useTranslation();

  return (
    <React.Fragment>
      <h5>{t("Datos Generales")}</h5>
      <p className="card-title-desc"></p>

      <AvForm id="frmGarantiasMuebles" className="needs-validation">
        <Row>
          <Col md="3">
            <div className="mb-3">
              <Label>{t("Fecha desde ")}</Label>
              <AvField
                className="form-control"
                name="estimatedDate"
                type="date"
                id="estimatedDate"
              />
            </div>
          </Col>

          <Col md="3">
            <div className="mb-3">
              <Label>{t("Fecha Hasta")}</Label>
              <AvField
                className="form-control"
                name="estimatedDate"
                type="date"
                id="estimatedDate"
              />
            </div>
          </Col>

          <Row></Row>
          <Col md="3">
            <div className="mb-3">
              <Label htmlFor="Nombre">{t("Nombre")}</Label>
              <AvField
                className="form-control"
                type="text"
                name="searchfield"
                id="searchfield"
                
              />
            </div>
          </Col>
          <Col md="3">
            <AvGroup check className="mb-3">
              <AvInput type="checkbox" name="Nombre" />
              <Label
                style={{ textAlign: "center" }}
                htmlFor="Nombre"
              >
                {t("NULL")}
              </Label>
            </AvGroup>
          </Col>

          <Col md="3">
            <div className="mb-2">
              <Label>{t("Numero de Cliente(s)")}</Label>
              <Select />
            </div>
          </Col>
          <Row></Row>
          <Col md="3">
            <div className="mb-3">
              <Label htmlFor="Grupoecco">{t("Grupo Economico ")}</Label>
              <AvField
                className="form-control"
                type="text"
                name="searchfield"
                id="searchfield"
                title={t("")}
              />
            </div>
          </Col>
          <Col md="3">
            <AvGroup check className="mb-3">
              <AvInput type="checkbox" name="GrupoEconomico" />
              <Label
                style={{ textAlign: "center" }}
                htmlFor="GrupoEconomico"
              >
                {t("NULL")}
              </Label>
            </AvGroup>
          </Col>
        </Row>
      </AvForm>
    </React.Fragment>
  );
};

export default withTranslation()(PantallaBusqueda);
